DROP TABLE IF EXISTS `secondlife_antiflood`;
CREATE TABLE IF NOT EXISTS `secondlife_antiflood` (
  `ip_addr` varchar(48) NOT NULL,
  `time` varchar(14) NOT NULL,
  KEY `ip_addr` (`ip_addr`),
  KEY `time` (`time`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `secondlife_authors`;
CREATE TABLE IF NOT EXISTS `secondlife_authors` (
  `aid` varchar(31) NOT NULL,
  `aid2` varchar(31) NOT NULL,
  `name` varchar(50) DEFAULT NULL,
  `url` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `pwd` varchar(40) DEFAULT NULL,
  `counter` int(11) NOT NULL DEFAULT '0',
  `radminsuper` tinyint(1) NOT NULL DEFAULT '1',
  `admlanguage` varchar(30) NOT NULL,
  PRIMARY KEY (`aid`),
  KEY `aid` (`aid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `secondlife_autonews`;
CREATE TABLE IF NOT EXISTS `secondlife_autonews` (
  `anid` int(11) NOT NULL AUTO_INCREMENT,
  `catid` int(11) NOT NULL DEFAULT '0',
  `aid` varchar(31) NOT NULL,
  `aid2` varchar(31) NOT NULL,
  `title` varchar(80) NOT NULL,
  `time` varchar(19) NOT NULL,
  `hometext` text NOT NULL,
  `bodytext` text NOT NULL,
  `topic` int(3) NOT NULL DEFAULT '1',
  `firstname` varchar(31) NOT NULL,
  `lastname` varchar(31) NOT NULL,
  `notes` text NOT NULL,
  `ihome` int(1) NOT NULL DEFAULT '0',
  `alanguage` varchar(30) NOT NULL,
  `acomm` int(1) NOT NULL DEFAULT '0',
  `associated` text NOT NULL,
  PRIMARY KEY (`anid`),
  KEY `anid` (`anid`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `secondlife_banned_ip`;
CREATE TABLE IF NOT EXISTS `secondlife_banned_ip` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `ip_address` varchar(15) NOT NULL,
  `reason` varchar(255) NOT NULL,
  `date` date NOT NULL DEFAULT '0000-00-00',
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `secondlife_banner`;
CREATE TABLE IF NOT EXISTS `secondlife_banner` (
  `bid` int(11) NOT NULL AUTO_INCREMENT,
  `cid` int(11) NOT NULL DEFAULT '0',
  `name` varchar(50) NOT NULL,
  `imptotal` int(11) NOT NULL DEFAULT '0',
  `impmade` int(11) NOT NULL DEFAULT '0',
  `clicks` int(11) NOT NULL DEFAULT '0',
  `imageurl` varchar(100) NOT NULL,
  `clickurl` varchar(200) NOT NULL,
  `alttext` varchar(255) NOT NULL,
  `date` datetime DEFAULT NULL,
  `dateend` datetime DEFAULT NULL,
  `position` int(10) NOT NULL DEFAULT '0',
  `active` tinyint(1) NOT NULL DEFAULT '1',
  `ad_class` varchar(5) NOT NULL,
  `ad_code` text NOT NULL,
  `ad_width` int(4) DEFAULT '0',
  `ad_height` int(4) DEFAULT '0',
  PRIMARY KEY (`bid`),
  KEY `bid` (`bid`),
  KEY `cid` (`cid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `secondlife_banner_clients`;
CREATE TABLE IF NOT EXISTS `secondlife_banner_clients` (
  `cid` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(60) NOT NULL,
  `contact` varchar(60) NOT NULL,
  `email` varchar(60) NOT NULL,
  `login` varchar(10) NOT NULL,
  `passwd` varchar(10) NOT NULL,
  `extrainfo` text NOT NULL,
  PRIMARY KEY (`cid`),
  KEY `cid` (`cid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `secondlife_banner_plans`;
CREATE TABLE IF NOT EXISTS `secondlife_banner_plans` (
  `pid` int(10) NOT NULL AUTO_INCREMENT,
  `active` tinyint(1) NOT NULL DEFAULT '0',
  `name` varchar(255) NOT NULL,
  `description` text NOT NULL,
  `delivery` varchar(10) NOT NULL,
  `delivery_type` varchar(25) NOT NULL,
  `price` varchar(25) NOT NULL DEFAULT '0',
  `buy_links` text NOT NULL,
  PRIMARY KEY (`pid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `secondlife_banner_positions`;
CREATE TABLE IF NOT EXISTS `secondlife_banner_positions` (
  `apid` int(10) NOT NULL AUTO_INCREMENT,
  `position_number` int(5) NOT NULL DEFAULT '0',
  `position_name` varchar(255) NOT NULL,
  PRIMARY KEY (`apid`),
  KEY `position_number` (`position_number`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `secondlife_banner_terms`;
CREATE TABLE IF NOT EXISTS `secondlife_banner_terms` (
  `terms_body` text NOT NULL,
  `country` varchar(255) NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `secondlife_blocks`;
CREATE TABLE IF NOT EXISTS `secondlife_blocks` (
  `bid` int(10) NOT NULL AUTO_INCREMENT,
  `bkey` varchar(15) NOT NULL,
  `title` varchar(60) NOT NULL,
  `content` text NOT NULL,
  `url` varchar(200) NOT NULL,
  `bposition` char(1) NOT NULL,
  `weight` int(10) NOT NULL DEFAULT '1',
  `active` int(1) NOT NULL DEFAULT '1',
  `refresh` int(10) NOT NULL DEFAULT '0',
  `time` varchar(14) NOT NULL DEFAULT '0',
  `blanguage` varchar(30) NOT NULL,
  `blockfile` varchar(255) NOT NULL,
  `view` int(1) NOT NULL DEFAULT '0',
  `expire` varchar(14) NOT NULL DEFAULT '0',
  `action` char(1) NOT NULL,
  `subscription` int(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`bid`),
  KEY `bid` (`bid`),
  KEY `title` (`title`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `secondlife_cities`;
CREATE TABLE IF NOT EXISTS `secondlife_cities` (
  `id` mediumint(4) NOT NULL DEFAULT '0',
  `local_id` mediumint(3) NOT NULL DEFAULT '0',
  `city` varchar(65) NOT NULL,
  `cc` char(2) NOT NULL,
  `country` varchar(35) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

