DROP TABLE IF EXISTS `secondlife_comments`;
CREATE TABLE IF NOT EXISTS `secondlife_comments` (
  `tid` int(11) NOT NULL AUTO_INCREMENT,
  `pid` int(11) NOT NULL DEFAULT '0',
  `sid` int(11) NOT NULL DEFAULT '0',
  `date` datetime DEFAULT NULL,
  `firstname` varchar(31) NOT NULL,
  `lastname` varchar(31) NOT NULL,
  `email` varchar(60) DEFAULT NULL,
  `url` varchar(60) DEFAULT NULL,
  `host_name` varchar(60) DEFAULT NULL,
  `subject` varchar(85) NOT NULL,
  `comment` text NOT NULL,
  `score` tinyint(4) NOT NULL DEFAULT '0',
  `reason` tinyint(4) NOT NULL DEFAULT '0',
  `last_moderation_ip` varchar(15) DEFAULT '0',
  PRIMARY KEY (`tid`),
  KEY `tid` (`tid`),
  KEY `pid` (`pid`),
  KEY `sid` (`sid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `secondlife_comments_moderated`;
CREATE TABLE IF NOT EXISTS `secondlife_comments_moderated` (
  `tid` int(11) NOT NULL AUTO_INCREMENT,
  `pid` int(11) NOT NULL DEFAULT '0',
  `sid` int(11) NOT NULL DEFAULT '0',
  `date` datetime DEFAULT NULL,
  `firstname` varchar(31) NOT NULL,
  `lastname` varchar(31) NOT NULL,
  `email` varchar(60) DEFAULT NULL,
  `url` varchar(60) DEFAULT NULL,
  `host_name` varchar(60) DEFAULT NULL,
  `subject` varchar(85) NOT NULL,
  `comment` text NOT NULL,
  `score` tinyint(4) NOT NULL DEFAULT '0',
  `reason` tinyint(4) NOT NULL DEFAULT '0',
  `last_moderation_ip` varchar(15) DEFAULT '0',
  PRIMARY KEY (`tid`),
  KEY `tid` (`tid`),
  KEY `pid` (`pid`),
  KEY `sid` (`sid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `secondlife_config`;
CREATE TABLE IF NOT EXISTS `secondlife_config` (
  `sitename` varchar(255) NOT NULL,
  `site_url` varchar(255) NOT NULL,
  `site_logo` varchar(255) NOT NULL,
  `slogan` varchar(255) NOT NULL,
  `startdate` varchar(50) NOT NULL,
  `adminmail` varchar(255) NOT NULL,
  `anonpost` tinyint(1) NOT NULL DEFAULT '0',
  `Default_Theme` varchar(255) NOT NULL,
  `overwrite_theme` tinyint(1) NOT NULL DEFAULT '1',
  `foot1` text NOT NULL,
  `foot2` text NOT NULL,
  `foot3` text NOT NULL,
  `commentlimit` int(9) NOT NULL DEFAULT '4096',
  `sl_firstname` varchar(31) NOT NULL,
  `sl_lastname` varchar(31) NOT NULL,
  `minpass` tinyint(1) NOT NULL DEFAULT '5',
  `pollcomm` tinyint(1) NOT NULL DEFAULT '1',
  `articlecomm` tinyint(1) NOT NULL DEFAULT '1',
  `broadcast_msg` tinyint(1) NOT NULL DEFAULT '1',
  `my_headlines` tinyint(1) NOT NULL DEFAULT '1',
  `top` int(3) NOT NULL DEFAULT '10',
  `storyhome` int(2) NOT NULL DEFAULT '10',
  `user_news` tinyint(1) NOT NULL DEFAULT '1',
  `oldnum` int(2) NOT NULL DEFAULT '30',
  `banners` tinyint(1) NOT NULL DEFAULT '1',
  `backend_title` varchar(255) NOT NULL,
  `backend_language` varchar(10) NOT NULL,
  `language` varchar(100) NOT NULL,
  `locale` varchar(10) NOT NULL,
  `multilingual` tinyint(1) NOT NULL DEFAULT '0',
  `useflags` tinyint(1) NOT NULL DEFAULT '0',
  `notify` tinyint(1) NOT NULL DEFAULT '0',
  `notify_email` varchar(255) NOT NULL,
  `notify_subject` varchar(255) NOT NULL,
  `notify_message` varchar(255) NOT NULL,
  `notify_from` varchar(255) NOT NULL,
  `moderate` tinyint(1) NOT NULL DEFAULT '0',
  `admingraphic` tinyint(1) NOT NULL DEFAULT '1',
  `httpref` tinyint(1) NOT NULL DEFAULT '1',
  `httprefmax` int(5) NOT NULL DEFAULT '1000',
  `httprefmode` tinyint(1) NOT NULL DEFAULT '1',
  `CensorMode` tinyint(1) NOT NULL DEFAULT '3',
  `CensorReplace` varchar(10) NOT NULL,
  `copyright` text NOT NULL,
  `Version_Num` varchar(10) NOT NULL,
  `gfx_chk` tinyint(1) NOT NULL DEFAULT '0',
  `wysiwyg_editor` tinyint(1) NOT NULL DEFAULT '1',
  `display_errors` tinyint(1) NOT NULL DEFAULT '0',
  `meta_keywords` text NOT NULL,
  `meta_description` varchar(255) NOT NULL,
  `paypal_email` varchar(255) NOT NULL DEFAULT 'dazzlecms@hotmail.com',
  `paypal_title` varchar(255) NOT NULL,
  `currency_code` varchar(3) NOT NULL DEFAULT 'USD',
  `paypal_url` varchar(255) NOT NULL,
  `paypal_return` varchar(255) NOT NULL,
  `paypal_cancel` varchar(255) NOT NULL,
  PRIMARY KEY (`sitename`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `secondlife_counter`;
CREATE TABLE IF NOT EXISTS `secondlife_counter` (
  `type` varchar(80) NOT NULL,
  `var` varchar(80) NOT NULL,
  `count` int(10) unsigned NOT NULL DEFAULT '0'
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `secondlife_groups`;
CREATE TABLE IF NOT EXISTS `secondlife_groups` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `description` text NOT NULL,
  `points` int(10) NOT NULL DEFAULT '0',
  KEY `id` (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `secondlife_groups_points`;
CREATE TABLE IF NOT EXISTS `secondlife_groups_points` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `points` int(10) NOT NULL DEFAULT '0',
  KEY `id` (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `secondlife_headlines`;
CREATE TABLE IF NOT EXISTS `secondlife_headlines` (
  `hid` int(11) NOT NULL AUTO_INCREMENT,
  `sitename` varchar(30) NOT NULL,
  `headlinesurl` varchar(200) NOT NULL,
  PRIMARY KEY (`hid`),
  KEY `hid` (`hid`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `secondlife_main`;
CREATE TABLE IF NOT EXISTS `secondlife_main` (
  `main_module` varchar(255) NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `secondlife_marketplace_categories`;
CREATE TABLE IF NOT EXISTS `secondlife_marketplace_categories` (
  `cid` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(50) NOT NULL,
  `parentid` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`cid`),
  KEY `cid` (`cid`),
  KEY `title` (`title`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `secondlife_marketplace_items`;
CREATE TABLE IF NOT EXISTS `secondlife_marketplace_items` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `category` int(10) NOT NULL DEFAULT '0',
  `subcategory` int(10) NOT NULL DEFAULT '0',
  `inventory` varchar(63) NOT NULL,
  `slurl` varchar(255) NOT NULL,
  `title` varchar(100) NOT NULL,
  `description` text NOT NULL,
  `editor` varchar(255) NOT NULL,
  `permissions` varchar(25) NOT NULL,
  `prims` int(10) NOT NULL,
  `lindens` int(10) NOT NULL,
  `dollars` int(10) NOT NULL,
  `quantity` int(10) NOT NULL,
  `adult` varchar(3) NOT NULL DEFAULT 'off',
  `sales` varchar(3) NOT NULL DEFAULT 'on',
  `messages` varchar(3) NOT NULL DEFAULT 'on',
  `enhancements` int(1) NOT NULL,
  `time` varchar(14) DEFAULT NULL,
  `image` text NOT NULL,
  `thumbnail` text NOT NULL,
  `firstname` varchar(31) NOT NULL,
  `lastname` varchar(31) NOT NULL,
  `updated` varchar(14) DEFAULT NULL,
  `date` datetime DEFAULT NULL,
  `sold` int(11) NOT NULL DEFAULT '0',
  `hits` int(11) NOT NULL DEFAULT '0',
  `rating` double(6,4) NOT NULL DEFAULT '0.0000',
  `votes` int(11) NOT NULL DEFAULT '0',
  `comments` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `lid` (`id`),
  KEY `cid` (`category`),
  KEY `sid` (`subcategory`),
  KEY `title` (`inventory`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `secondlife_marketplace_magicbox`;
CREATE TABLE IF NOT EXISTS `secondlife_marketplace_magicbox` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `firstname` varchar(31) NOT NULL DEFAULT '',
  `lastname` varchar(31) NOT NULL DEFAULT '',
  `server_key` varchar(36) NOT NULL DEFAULT '',
  `server_url` text NOT NULL,
  `server_location` text NOT NULL,
  `server_name` varchar(63) NOT NULL,
  `server_desc` varchar(63) NOT NULL,
  `server_status` tinyint(1) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `id` (`id`),
  KEY `firstname` (`firstname`),
  KEY `lastname` (`lastname`),
  KEY `uuid_key` (`server_key`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `secondlife_marketplace_magicbox_products`;
CREATE TABLE IF NOT EXISTS `secondlife_marketplace_magicbox_products` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `firstname` varchar(31) NOT NULL,
  `lastname` varchar(31) NOT NULL,
  `avatar_key` varchar(36) NOT NULL,
  `server_key` varchar(36) NOT NULL,
  `product_name` text NOT NULL,
  `product_type` int(11) NOT NULL DEFAULT '-1',
  `product_active` int(1) NOT NULL,
  `product_date` varchar(14) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `id` (`id`),
  KEY `firstname` (`firstname`),
  KEY `lastname` (`lastname`),
